import "./App.css";
import { useState } from "react";

import Mode from "../../components/Mode/Mode";
import Header from "../../components/Header/Header";
import { About } from "../../components/About/About";
import { Bio } from "../../components/Bio/Bio";
import { Footer } from "../../components/Footer/Footer";
import Project from "../../components/Project/Project";
import Calendar from "../calendar/Calendar";

function Content({ props }) {
  switch (props) {
    case "calendar":
      return <Calendar />
    default:
      return <div>
        <Header />
        <About />
        <Bio />
        <Project />
        <Footer />
      </div>
  }
}

function Home({ fill }) {
  const [whiteMode, setQuietMode] = useState(false);
  const [opsi, setOpsi] = useState(false);
  if (fill === "") setOpsi("default")
  if (fill !== "") setOpsi("blog")
  // const [content, setContent] = useState("")
  console.log(fill)

  const handleModeChange = () => {
    setQuietMode(!whiteMode);
  };


  return (
    <div className={whiteMode ? "white-mode" : "dark-mode"}>
      <Mode setMode={whiteMode} handleModeChange={handleModeChange} opsi={opsi} />

      <Content props={fill} />

    </div>
  );
}

export default Home;
